using System;
using System.Linq;
using System.Text;
using System.IO;
using Estudo.Framework.VSSelenium.Utils;
using Estudo.Framework.VSSelenium.Evidencias;

namespace Estudo.Framework.VSSelenium.Evidencias
{
    public static class GeraHtmlEvidencia
    {

        public static void GeraHtml(string NomeCenarioTeste, string idTFS, string nomeArquivo, TipoEvidencias tipoEvidencia, LogEvidencias evidencia, string folderTest = "")
        {
            string caminhoRaiz = Utils.Environment.DiretorioEvidencia();

            if (!string.IsNullOrWhiteSpace(folderTest))
            {
                caminhoRaiz = caminhoRaiz + folderTest.Replace(".", "\\");
                Directory.CreateDirectory(caminhoRaiz);
            }

            string fileReport = caminhoRaiz + "\\" + idTFS + "_" + nomeArquivo + "_" + DateTime.Now.Ticks + ".html";
            string NomeEquipe = Utils.Environment.RetornarEquipe();
            string NomeProjeto = Utils.Environment.RetornarProjeto();

            //PrintWriter writer = new PrintWriter(fileReport, "iso-8859-1");
            using (var streamWriter = new StreamWriter(new FileStream(fileReport, FileMode.CreateNew, FileAccess.Write), Encoding.UTF8))
            {
                //Inicia o HTML
                streamWriter.WriteLine("<!DOCTYPE html>                                                                                                                 ");
                streamWriter.WriteLine("<html>                                                                                                                          ");
                streamWriter.WriteLine("<head>                                                                                                                          ");
                streamWriter.WriteLine("    <meta charset='utf-8' />                                                                                                    ");
                streamWriter.WriteLine("    <title>Relatório e Evidência de Teste Automatizado de Software</title>                                                      ");

                //Inclui referencias externas de Jquery e Bootstrap
                streamWriter.WriteLine("    <link href='https://stackpath.bootstrapcdn.com/bootstrap/4.1.1/css/bootstrap.min.css' rel='stylesheet'                      ");
                streamWriter.WriteLine("    	integrity='sha384-WskhaSGFgHYWDcbwN70/dfYBj47jz9qbsMId/iRN3ewGhXQFZCSftd1LZCfmhktB' crossorigin='anonymous'>            ");
                streamWriter.WriteLine("    <script src='https://code.jquery.com/jquery-3.3.1.min.js'                                                                   ");
                streamWriter.WriteLine("		integrity='sha256-FgpCb/KJQlLNfOu91ta32o/NMZxltwRo8QtmkMRdAu8=' crossorigin='anonymous'></script>                       ");
                streamWriter.WriteLine("    <script src='https://stackpath.bootstrapcdn.com/bootstrap/4.1.1/js/bootstrap.min.js'                                        ");
                streamWriter.WriteLine("		integrity='sha384-smHYKdLADwkXOn1EmN1qk/HfnUcbVRZyYmZ4qpPea6sjB/pTJ0euyQp0Mk8ck+5T'	 crossorigin='anonymous'></script>	");

                //Inclui Funcionalidades de Javascript
                streamWriter.WriteLine("    <script type='text/javascript'>                                                                                             ");
                streamWriter.WriteLine("        $(document).ready(function () {                                                                                         ");
                streamWriter.WriteLine("            $('div.accordion').click(function () {                                                                              ");
                streamWriter.WriteLine("                $(this).parent().find('div.panel').slideToggle('slow');                                                         ");
                streamWriter.WriteLine("            });                                                                                                                 ");
                streamWriter.WriteLine("        });                                                                                                                     ");
                streamWriter.WriteLine("        $(function () {                                                                                                         ");
                streamWriter.WriteLine("            $('.Evidencia').each(function (indice, elemento) {                                                                  ");
                streamWriter.WriteLine("                var status = $(this).find('.status').text();                                                                    ");
                streamWriter.WriteLine("                if (status == 'Passed') {                                                                                       ");
                streamWriter.WriteLine("                    $(this).find('.evTitulo').css('background-color', 'forestgreen');                                           ");
                streamWriter.WriteLine("                } else if (status == 'Failed') {                                                                                ");
                streamWriter.WriteLine("                    $(this).find('.evTitulo').css('background-color', 'red');                                                   ");
                streamWriter.WriteLine("                } else if (status == 'Skipped') {                                                                               ");
                streamWriter.WriteLine("                    $(this).find('.evTitulo').css('background-color', 'gold');                                                  ");
                streamWriter.WriteLine("                } else {                                                                                                        ");
                streamWriter.WriteLine("                    $(this).find('.evTitulo').css('background-color', '');                                                      ");
                streamWriter.WriteLine("                }                                                                                                               ");
                streamWriter.WriteLine("            });                                                                                                                 ");
                streamWriter.WriteLine("            $('.status').each(function (indice, elemento) {                                                                     ");
                streamWriter.WriteLine("                var status = $(this).text();                                                                                    ");
                streamWriter.WriteLine("                if (status == 'Passed') {                                                                                       ");
                streamWriter.WriteLine("                    $(this).css('color', 'forestgreen');                                                                        ");
                streamWriter.WriteLine("                } else if (status == 'Failed') {                                                                                ");
                streamWriter.WriteLine("                    $(this).css('color', 'red');                                                                                ");
                streamWriter.WriteLine("                } else if (status == 'Skipped') {                                                                               ");
                streamWriter.WriteLine("                    $(this).css('color', 'gold');                                                                               ");
                streamWriter.WriteLine("                } else {                                                                                                        ");
                streamWriter.WriteLine("                    $(this).css('color', 'black');                                                                              ");
                streamWriter.WriteLine("                }                                                                                                               ");
                streamWriter.WriteLine("            });                                                                                                                 ");
                streamWriter.WriteLine("        });                                                                                                                     ");
                streamWriter.WriteLine("    </script>                                                                                                                   ");

                //Inclui Estilização CSS
                streamWriter.WriteLine("    <style>                                                                                                                     ");
                streamWriter.WriteLine("        body {                                                                                                                  ");
                streamWriter.WriteLine("            width: 96%;                                                                                                         ");
                streamWriter.WriteLine("            margin: 1% 1% 1% 1%;                                                                                                ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        h3 {                                                                                                                    ");
                streamWriter.WriteLine("            float: left;                                                                                                        ");
                streamWriter.WriteLine("            width: 80%;                                                                                                         ");
                streamWriter.WriteLine("            text-align: center;                                                                                                 ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        table {                                                                                                                 ");
                streamWriter.WriteLine("            width: 100%;                                                                                                        ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .ocultar {                                                                                                              ");
                streamWriter.WriteLine("            border: none;                                                                                                       ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .status {                                                                                                               ");
                streamWriter.WriteLine("            font-weight: bold;                                                                                                  ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .Evidencia {                                                                                                            ");
                streamWriter.WriteLine("            width: 100%;                                                                                                        ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .EvidenciaIMG {                                                                                                         ");
                streamWriter.WriteLine("            width: 100%;                                                                                                        ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .evConteudo {                                                                                                           ");
                streamWriter.WriteLine("            display: none;                                                                                                      ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .evTitulo {                                                                                                             ");
                streamWriter.WriteLine("            font-weight: 600;                                                                                                   ");
                streamWriter.WriteLine("            font-style: italic;                                                                                                 ");
                streamWriter.WriteLine("            font-family: serif;                                                                                                 ");
                streamWriter.WriteLine("            padding: 0.25% 0.5% 0.25% 0.5%;                                                                                     ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .teste {                                                                                                                ");
                streamWriter.WriteLine("            background-color: orange;                                                                                           ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        .evTitulo:hover {                                                                                                       ");
                streamWriter.WriteLine("            opacity: 0.9;                                                                                                       ");
                streamWriter.WriteLine("            transition: all 0.5s;                                                                                               ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("                                                                                                                                ");
                streamWriter.WriteLine("        .logo {                                                                                                                 ");
                streamWriter.WriteLine("            width: 200px;                                                                                                       ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        #logo_cliente {                                                                                                         ");
                streamWriter.WriteLine("            float: left;                                                                                                        ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        #logo_consultoria {                                                                                                     ");
                streamWriter.WriteLine("            float: right;                                                                                                       ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        #ResumoExecucao {                                                                                                       ");
                streamWriter.WriteLine("            border: none;                                                                                                       ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("            #ResumoExecucao td {                                                                                                ");
                streamWriter.WriteLine("                border-color: black;                                                                                            ");
                streamWriter.WriteLine("            }                                                                                                                   ");
                streamWriter.WriteLine("        div.accordion {                                                                                                         ");
                streamWriter.WriteLine("            cursor: pointer;                                                                                                    ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("        div.panel {                                                                                                             ");
                streamWriter.WriteLine("            display: none;                                                                                                      ");
                streamWriter.WriteLine("        }                                                                                                                       ");
                streamWriter.WriteLine("    </style>                                                                                                                    ");

                streamWriter.WriteLine("</head>                                                                                                                         ");

                var evidencias = evidencia.GetEvidencias();

                streamWriter.WriteLine("<body>                                                                                                                          ");
                streamWriter.WriteLine("    <div>                                                                                                                       ");
                streamWriter.WriteLine("        <img class='logo' id='logo_cliente' src='data:image/png;base64,' />                                              ");
                streamWriter.WriteLine("    </div>                                                                                                                      ");
                streamWriter.WriteLine("    <div>                                                                                                                       ");
                streamWriter.WriteLine("        <h3>Relatório e Evidência de Teste Automatizado de Software</h3>                                                        ");
                streamWriter.WriteLine("    </div>                                                                                                                      ");
                streamWriter.WriteLine("    <div>                                                                                                                       ");
                streamWriter.WriteLine("        <img class='logo' id='logo_consultoria' src='data:image/png;base64,' />                                       ");
                streamWriter.WriteLine("    </div>                                                                                                                      ");
                streamWriter.WriteLine("    <br />  <br />  <br />  <br />  <br />                                                                                      ");

                var a = evidencias.Select(x => x.Status).ToList();
                var TotalPasseds = evidencias.Where(x => x.Status == true).Count();
                var TotalFaileds = evidencias.Where(x => x.Status == false).Count();

                streamWriter.WriteLine("    <table border='1' id='ResumoExecucao'>                                                                                      ");
                streamWriter.WriteLine("        <tbody>                                                                                                                 ");
                streamWriter.WriteLine("            <tr>                                                                                                                ");
                streamWriter.WriteLine("                <td>Equipe:</td>                                                                                               ");
                streamWriter.WriteLine("                <td>" + NomeEquipe + "</td>                                                                                        ");
                streamWriter.WriteLine("                <td>Projeto:</td>                                                                                               ");
                streamWriter.WriteLine("                <td>" + NomeProjeto + "</td>                                                                                      ");
                streamWriter.WriteLine("                <td>Data/Hora:</td>                                                                                             ");
                streamWriter.WriteLine("                <td>" + DateTime.Now.ToString() + "</td>                                                                            ");
                streamWriter.WriteLine("                <td>Passed:</td>                                                                                                ");
                streamWriter.WriteLine("                <td>" + TotalPasseds + "</td>                                                                                       ");
                streamWriter.WriteLine("            </tr>                                                                                                               ");
                streamWriter.WriteLine("            <tr>                                                                                                                ");
                streamWriter.WriteLine("                <td>Cenário de teste:</td>                                                                                      ");
                streamWriter.WriteLine("                <td colspan='5'>" + NomeCenarioTeste + "</td>                                                                       ");
                streamWriter.WriteLine("                <td>Failed:</td>                                                                                                ");
                streamWriter.WriteLine("                <td>" + TotalFaileds + "</td>                                                                                   ");
                streamWriter.WriteLine("            </tr>                                                                                                               ");
                streamWriter.WriteLine("            <tr>                                                                                                                ");
                streamWriter.WriteLine("                <td colspan='6' class='ocultar'>  </td>                                                                         ");
                streamWriter.WriteLine("                <td>Status</td>                                                                                                 ");
                streamWriter.WriteLine("                <td class='status'>" + (TotalFaileds == 0 ? "Passed" : "Failed") + "</td>                                           ");
                streamWriter.WriteLine("            </tr>                                                                                                               ");
                streamWriter.WriteLine("        </tbody>                                                                                                                ");
                streamWriter.WriteLine("    </table>                                                                                                                    ");
                streamWriter.WriteLine("    <br />                                                                                                                      ");

                for (int i = 0; i <= evidencias.Count - 1; i++)
                {
                    streamWriter.WriteLine("    <div class='Evidencia'>                                                                                                     ");
                    streamWriter.WriteLine("        <div class='evTitulo accordion'>                                                                                        ");
                    streamWriter.WriteLine("            " + evidencias[i].ValidacaoStep + "                                                                                      ");
                    streamWriter.WriteLine("        </div>                                                                                                                  ");
                    streamWriter.WriteLine("        <div class='evConteudo panel'>                                                                                          ");
                    streamWriter.WriteLine("            <table border='1'>                                                                                                  ");
                    streamWriter.WriteLine("                <tbody>                                                                                                         ");
                    streamWriter.WriteLine("                    <tr>                                                                                                        ");
                    streamWriter.WriteLine("                        <td>Esperado:</td>                                                                                      ");
                    streamWriter.WriteLine("                        <td>" + evidencias[i].Esperado + "</td>                                                                 ");
                    streamWriter.WriteLine("                        <td rowspan='2'>Status:</td>                                                                            ");
                    streamWriter.WriteLine("                        <td rowspan='2' class='status'>" + (evidencias[i].Status ? "Passed" : "Failed") + "</td>                ");
                    streamWriter.WriteLine("                    </tr>                                                                                                       ");
                    streamWriter.WriteLine("                    <tr>                                                                                                        ");
                    streamWriter.WriteLine("                        <td>Obtido:</td>                                                                                        ");
                    streamWriter.WriteLine("                        <td>" + evidencias[i].Obtido + "</td>                                                                   ");
                    streamWriter.WriteLine("                    </tr>                                                                                                       ");
                    streamWriter.WriteLine("                </tbody>                                                                                                        ");
                    streamWriter.WriteLine("            </table>                                                                                                            ");
                    streamWriter.WriteLine("            <img class='EvidenciaIMG'                                                                                           ");

                    if (tipoEvidencia.Equals(TipoEvidencias.PADRÃO_SEMPRE))
                    {
                        streamWriter.Write("            src='" + evidencias[i].ImageAsBase64 + "'                                                                           ");
                    }
                    else if ((tipoEvidencia.Equals(TipoEvidencias.FALHA_FINALIZA)
                            || tipoEvidencia.Equals(TipoEvidencias.FALHA_CONTINUA))
                            && evidencias[i].Status == false)
                    {
                        streamWriter.Write("            " + evidencias[i].ImageAsBase64 + "                                                                                 ");
                    }
                    else if (tipoEvidencia.Equals(TipoEvidencias.SEM_SCREENSHOT))
                    {
                        streamWriter.Write("            " + evidencias[i].ImageAsBase64 + "                                                                                 ");
                    }
                    else if (tipoEvidencia.Equals(TipoEvidencias.ULTIMO_SCREENSHOT) && i == evidencias.Count - 1)
                    {
                        streamWriter.Write("            " + evidencias[i].ImageAsBase64 + "                                                                                 ");
                    }
                    streamWriter.Write("            />         \n                                                                                                           ");

                    streamWriter.WriteLine("        </div>                                                                                                                  ");
                    streamWriter.WriteLine("    </div>                                                                                                                      ");
                    streamWriter.WriteLine("    <br />                                                                                                                      ");
                }
                streamWriter.WriteLine("</BODY>");
                streamWriter.WriteLine("</HTML>");
                streamWriter.Close();
                streamWriter.Dispose();
            }
        }
    }
}
